import React from 'react'

const Home = () => {

  var styles = {
    h1: {
      color:"Green",
      padding:"100px",
      fontsize: "300%",
      margin: "auto",
      width: "1000px",
    },
    div:{
      backgroundImage: `url("https://jsmsikkim.com/images/11.png")`,
      padding:"100px"
    }
  }

  return (
    <div style={styles.div}>
    <h1 style={styles.h1}>Welcome to Real Estate Broker Application</h1>
    </div>
  );
}

export default Home
